import Card from '../Card'
import Form from '../Form'

var backgroudStyle={
  backgroundImage: `url(${hh})`,
  backgroundSize:"auto"
}
const App =()=>{
  return (
    <div className="App">
    <Navbar
    color="light"
    expand="md"
    light
  >
    <NavbarBrand href="/">
    <h1>nearby Therapist</h1>
    <span>Find Your Top Local Therapists</span>
    </NavbarBrand>
      </Navbar>
      <div className="page-header-image" style={backgroudStyle}></div>
      {/* <Container className="bg-light border">
    <img src={hh} style={{width:"85%"}} />
    <Form/>
  </Container> */}
  <Container className="bg-light border" >
    <Card/>
    </Container>
  </div>
    
  );
  }

export default App;
